<script>
    (function(){
        require(['jquery-1.10.2.min'],function(){
            require(['lib/h5/m/m-4.6.min'],function(){
                commonRadio();//执行模拟单选框
                function textToImg() {
                    var i = 0;
                    var fontSize = 20;
                    var fontWeight = 'bold';
                    var name = $("#name").val();//姓名
                    var xueyuan= $("#xueyuan").val();//学院
                    var zhuanye= $("#zhuanye").val();//专业
                    
                    var univs = $('#univs').val(),
                        score = $('#score').val(),
                        type = $('input[name="type"]:checked').val(),
                        prize='',
                        type_text='';

                    /*if (name == '' || xueyuan == '' || zhuanye == '' ) {
                        alert('请输入完整信息～');
                        $("#name")[0].focus();
                        return false;
                    }*/
                    if(score>=0&&score<=30){
                        prize='贡献奖';
                    }
                    if(score>30&&score<=50){
                        prize='菜鸟奖';
                    }
                    if(score>50&&score<=70){
                        prize='高手奖';
                    }
                    if(score>70&&score<=90){
                        prize='膜拜奖';
                    }
                    if(score>90){
                        prize='大神奖';
                    }
                    switch(type){
                        case '1':type_text='数学类';
                        break;
                        case '0':type_text='非数学类';
                        break;
                    }
                    var canvas = $('#canvas')[0];
                    var context = canvas.getContext('2d');
                    var qinghua=$("#qinghua")[0];
                    canvas.width=qinghua.width;
                    canvas.height=qinghua.height;

                    context.clearRect(0, 0, canvas.width, canvas.height);
                    context.font = fontWeight + ' ' + fontSize + 'px songti';
                    context.textAlign = 'right';
                    context.textBaseline = 'top';
                    context.drawImage(qinghua,0,0);

                    console.log(type_text+','+univs+','+prize);
                    
                    context.fillText(name, 550, 316, 100);
                    context.fillText(univs, 320, 316);
                    context.fillText(prize, 500, 370);
                    context.fillText(type_text, 360, 370);
                    

                    $("#form").hide();
                    $(".loading").show();
                    $('#canvas').hide();

                    var imageData = context.getImageData(0, 0, canvas.width, canvas.height);
                    var img = $("#img")[0];
                    img.src = canvas.toDataURL("image/png");

                    setTimeout(function(){
                        $(".loading").hide();
                        $("#show").show();
                    },1000);
                }
                var $form=$('#form');
                require(['dist/jquery.validate.min','dist/jquery.validate.config.min','dist/messages_cn.min'],function(){
                    $form.validate({
                        submitHandler : function(){
                            textToImg();
                            return false;
                        }
                    });
                });
            });
        });
    })();
</script>
